def solve():
    s = input()

    openings = [i for i, c in enumerate(s) if c == "["]
    closings = [i for i, c in enumerate(s) if c == "]"]
    colons = [i for i, c in enumerate(s) if c == ":"]
    pipes = [i for i, c in enumerate(s) if c == "|"]

    if len(openings) != 1 or len(closings) != 1 or len(colons) < 2:
        print(-1)
        return

    start = openings[0]
    end = closings[0]

    max_length = 4

    for colon_index in colons:
        if start < colon_index < end:
            max_length += 1

    for pipe_index in pipes:
        if start < pipe_index < end:
            max_length += 1

    print(max_length)

solve()

