def solve():
    n, q = map(int, input().split())
    painters = []
    for _ in range(q):
        l, r = map(int, input().split())
        painters.append((l, r))

    painters.sort(key=lambda x: x[0])
    segments = []
    for i in range(q-2):
        segments.append((painters[i][1], painters[i+1][0]))

    max_painted = 0
    for start, end in segments:
        painted = 0
        for l, r in painters:
            if l <= start <= r or l <= end <= r:
                painted += min(r, end) - max(l, start) + 1
        max_painted = max(max_painted, painted)

    return max_painted

solve()

