def solve():
    import datetime

    def is_palindrome(time_str):
        return time_str == time_str[::-1]

    def next_palindrome_time(curr_time):
        curr_hour, curr_min = map(int, curr_time.split(":"))
        curr_dt = datetime.datetime(2000, 1, 1, curr_hour, curr_min)

        while True:
            curr_dt += datetime.timedelta(minutes=1)
            next_time_str = curr_dt.strftime("%H:%M")
            if is_palindrome(next_time_str):
                return next_time_str

    def minutes_to_next_palindrome(curr_time):
        next_palindrome = next_palindrome_time(curr_time)
        next_hour, next_min = map(int, next_palindrome.split(":"))
        curr_hour, curr_min = map(int, curr_time.split(":"))

        minutes = (next_hour - curr_hour) * 60 + (next_min - curr_min)
        if minutes < 0:
            minutes += 24 * 60

        return minutes

    time_str = input().strip()
    print(minutes_to_next_palindrome(time_str))

solve()

