def find_permutation(a, b):
    a_str = str(a)
    b_str = str(b)
    sorted_a = sorted(a_str, reverse=True)
    if len(a_str) < len(b_str):
        return int(''.join(sorted_a))

    for i in range(len(a_str)):
        if a_str[i] < sorted_a[i]:
            next_largest_index = next((j for j in range(len(a_str)) if a_str[j] < sorted_a[j]), None)
            swap = a_str[:i] + a_str[next_largest_index] + a_str[i+1:next_largest_index] + a_str[i] + a_str[next_largest_index+1:]
            return int(swap)

    return a

solve()

