def solve():
    a1, b1, a2, b2, L, R = map(int, input().split())

    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    def ext_gcd(a, b):
        if b == 0:
            return 1, 0, a
        x1, y1, gcd_val = ext_gcd(b, a % b)
        x, y = y1, x1 - (a // b) * y1
        return x, y, gcd_val

    def count_solutions(a, b, m, L, R):
        if a == 0 and b == 0:
            return R - L + 1
        if a == 0:
            return 0 if b < L or b > R else R - b // m + 1
        g = gcd(a, m)
        if (b - b // g * g) % g != 0:
            return 0
        x, y, g = ext_gcd(a, m)
        x *= (b // g)
        y *= (b // g)
        m //= g
        x %= m
        L = (L - x) // m
        R = (R - x) // m
        return max(0, R - L + 1)

    m = a1 - a2
    b = b2 - b1

    count = 0
    for d in range(1, int(m**0.5)+1):
        if m % d == 0:
            if m // d != d:
                count += count_solutions(d, b, m, max(0, (L-b)//a1), (R-b)//a1)
                count += count_solutions(m // d, b, m, max(0, (L-b)//a1), (R-b)//a1)
            else:
                count += count_solutions(d, b, m, max(0, (L-b)//a1), (R-b)//a1)

    return count

