def solve():
    import math

    def get_coordinates(n):
        k = math.ceil((math.sqrt(12 * n + 9) - 3) / 6)
        start = 3 * k * (k - 1) + 1
        side = 2 * k - 1
        remainder = n - start

        if remainder < side:
            return (-k, remainder)
        elif remainder < 2 * side:
            return (-k + remainder - side, side)
        elif remainder < 3 * side:
            return (remainder - 3 * k, k)
        elif remainder < 4 * side:
            return (k, 3 * k - remainder)
        elif remainder < 5 * side:
            return (2 * k - remainder + 3 * k, -k)
        else:
            return (remainder - 6 * k, -2 * k)

    n = int(input())
    x, y = get_coordinates(n)
    print(f"{x} {y}")

