def solve():
    # Take input from user
    input_str = input().strip()

    # Extract row number and seat letter
    row_num = int(input_str[:-1])
    seat_letter = input_str[-1]

    # Define functions to calculate serving time
    def serving_time(row):
        return row * 6

    def serve_first(row, seat):
        return serving_time(row) + (6 - ord(seat) + 97)

    def serve_second(row, seat):
        return serving_time(row) + ord(seat) - 99

    # Determine serving order based on row number
    if row_num % 4 == 1 or row_num % 4 == 2:
        if row_num % 2 == 1:
            print(serve_first(row_num, seat_letter))
        else:
            print(serving_time(row_num) + 1 + serve_second(row_num - 1, seat_letter))
    else:
        print(serving_time(row_num - row_num % 4) + 2 + serve_first(row_num % 4, seat_letter))

solve()

