def solve():
    n = int(input())
    arr = list(map(int, input().split()))

    increasing = True
    decreasing = False

    # Check for increasing part
    for i in range(1, n):
        if arr[i] <= arr[i - 1]:
            if arr[i] < arr[i - 1]:  # Not constant
                increasing = False
            break

    # Check for constant part
    for j in range(i, n):
        if arr[j] != arr[j - 1]:
            if j == i:  # No constant part
                increasing = False
            break

    # Check for decreasing part
