def solve():
    import sys
    n, m, r, k = map(int, sys.stdin.readline().split())
    def count_fishes(x, y):
        x_min = max(1, x - r + 1)
        x_max = min(n - r + 1, x) + 1
        y_min = max(1, y - r + 1)
        y_max = min(m - r + 1, y) + 1
        return (x_max - x_min) * (y_max - y_min)
    total_fishes = min(n, m) - r + 1
    if total_fishes <= 0:
        print(0.0)
        return
    fishes = {}
    for x in range(1, n + 1):
        for y in range(1, m + 1):
            fishes[(x, y)] = count_fishes(x, y)
    sorted_fishes = sorted(fishes.items(), key=lambda x: x[1], reverse=True)
    best_fishes = sorted_fishes[:k]
    expected_fishes = sum([fish[1] for fish in best_fishes]) / total_fishes
    print("{:.10f}".format(expected_fishes))

solve()

