    vertical_lines = [list(map(int, input().split())) for _ in range(N)]
    horizontal_lines = [list(map(int, input().split())) for _ in range(M)]

    def check_intersection(x, y, vertical_lines, horizontal_lines):
        for v_line in vertical_lines:
            if v_line[0] < x < v_line[1] and v_line[2] < y < v_line[2] + 1:
                return True
        for h_line in horizontal_lines:
            if h_line[0] < y < h_line[1] and h_line[2] < x < h_line[2] + 1:
                return True
        return False

