        area = 1
        for x in range(-10**9, 10**9):
            for y in range(-10**9, 10**9):
                if not check_intersection(x, y, vertical_lines, horizontal_lines):
                    area += 1
                    if area > 10**9:
                        return "INF"
        return area

    return calculate_area()

