def solve():
    n = int(input())
    s = input()

    total_question_marks = s.count('?')
    allowed_diff = total_question_marks % 4

    if len(s) % 4 != 0 or allowed_diff > 0:
        print("===")
    else:
        freq = {'A': s.count('A'), 'C': s.count('C'), 'G': s.count('G'), 'T': s.count('T')}
        equal = total_question_marks // 4

        to_fill = {k: max(0, equal - v) for k, v in freq.items()}

        res = []
        for char in s:
            if char == '?':
                for key, val in to_fill.items():
                    if val > 0:
                        res.append(key)
                        to_fill[key] -= 1
                        break
            else:
                res.append(char)

        print(''.join(res))

solve()

