    x, y, l, r = map(int, input().split())

    lucky_years = set()
    for i in range(60):
        for j in range(60):
            if x**i + y**j <= r:
                lucky_years.add(x**i + y**j)

    lucky_years = sorted(list(lucky_years))
    max_gap = 0
    start = l - 1

    for year in lucky_years:
        if year - start > max_gap:
            max_gap = year - start
        start = year

    if r - start > max_gap:
        max_gap = r - start

    print(max_gap)

solve()

