from math import sqrt

def solve():
    n = int(input())

    def get_divisors(num):
        divisors = set()
        for i in range(2, int(sqrt(num)) + 1):
            if num % i == 0:
                divisors.add(i)
                divisors.add(num // i)
        return divisors

    divisors = get_divisors(n)
    min_tax = n
    for divisor in divisors:
        if divisor >= 2:
            min_tax = min(min_tax, n // divisor)

    return min_tax

