from itertools import combinations_with_replacement

def solve():
    n, k, M = map(int, input().split())
    times = list(map(int, input().split()))

    max_points = 0

    for num_solved_subtasks in range(k+1):
        for chosen_times in combinations_with_replacement(times, num_solved_subtasks):
            total_time = sum(chosen_times)
            if total_time <= M:
                points = num_solved_subtasks + min((M - total_time) // sum(times), n - num_solved_subtasks)
                max_points = max(max_points, points)

    print(max_points)

solve()

