def solve(n: int):
    MOD = 998244353

    def binomial_coefficient(n, k):
        if k == 0 or k == n:
            return 1
        if k > n - k:
            return binomial_coefficient(n, n - k)
        result = 1
        for i in range(k):
            result = (result * (n - i)) % MOD
            result = (result * pow(i + 1, MOD - 2, MOD)) % MOD
        return result

    def count_trees(vertices):
        if vertices % 2 == 0:
            return 0
        return binomial_coefficient(vertices, vertices // 2)

    if n % 2 == 0:
        return 0
    return count_trees(n) % MOD

solve()

