    def count_trailing_zeros(num, base):
        zeros = 0
        while num % base == 0:
            zeros += 1
            num //= base
        return zeros

    def factorial(n):
        result = 1
        for i in range(2, n+1):
            result *= i
        return result

    fact = factorial(n)

    return count_trailing_zeros(fact, b)

