def solve():
    import heapq

    def dijkstra(graph, start):
        distances = {vertex: float('infinity') for vertex in graph}
        distances[start] = 0
        pq = [(0, start)]
        while pq:
            current_distance, current_vertex = heapq.heappop(pq)
            if current_distance > distances[current_vertex]:
                continue
            for neighbor, weight in graph[current_vertex].items():
                distance = current_distance + weight
                if distance < distances[neighbor]:
                    distances[neighbor] = distance
                    heapq.heappush(pq, (distance, neighbor))
        return distances

    n, m, k = map(int, input().split())
    special_vertices = list(map(int, input().split()))
    graph = {i: {} for i in range(1, n+1)}
    for _ in range(m):
        u, v, w = map(int, input().split())
        graph[u][v] = w
        graph[v][u] = w

    distances = {vertex: dijkstra(graph, vertex) for vertex in special_vertices}
    max_distances = [max(distances[x].values()) for x in special_vertices]

    print(' '.join(map(str, max_distances)))

solve()

