def solve():
    MOD = 10**9 + 7

    n, m = map(int, input().split())

    fact = [1] * (m+1)
    for i in range(2, m+1):
        fact[i] = (fact[i-1] * i) % MOD

    def power(a, b):
        if b == 0:
            return 1
        temp = power(a, b // 2)
        if b % 2 == 0:
            return (temp * temp) % MOD
        else:
            return (temp * temp * a) % MOD

    def mod_inv(a):
        return power(a, MOD-2)

    def ncr(n, r):
        return (fact[n] * mod_inv((fact[r] * fact[n-r]) % MOD)) % MOD

    ans = ncr(m, n) * fact[n] % MOD * fact[m-n] % MOD * power(2, n) % MOD

    print(ans)

solve()

