from typing import List

def solve(N: int, M: int, passages: List[List[int]]) -> float:
    edges = [0] * N
    for s, t in passages:
        edges[s-1] += 1

    min_expected_passages = 0
    for edge_count in edges:
        min_expected_passages += 1 / edge_count if edge_count != 0 else 0

    return min_expected_passages

