def solve():
    import sys

    def read_input():
        return sys.stdin.readline().strip()

    def print_output(output):
        sys.stdout.write(str(output))

    s = read_input()
    t = read_input()

    indices = {}
    for i in range(len(s)):
        if s[i] in indices:
            if indices[s[i]] != t[i]:
                print_output("-1")
                return
        else:
            indices[s[i]] = t[i]

    swaps = []
    visited = set()
    for c in indices:
        if c in visited:
            continue
        visited.add(c)

        if indices[c] != c:
            swaps.append((c, indices[c]))
            visited.add(indices[c])

    print_output(len(swaps) + '\n')
    for pair in swaps:
        print_output(pair[0] + ' ' + pair[1] + '\n')

solve()

