def solve():
    n, x, y, c = map(int, input().split())

    def count_cells_filled(t):
        return max(1, t + 1 - abs(x - 1) - abs(n - x) - abs(y - 1) - abs(n - y))

    def total_filled(t):
        return count_cells_filled(t) + count_cells_filled(t - 1)

    def get_time_needed(target):
        left, right = 0, c
        while left < right:
            mid = (left + right) // 2
            filled = total_filled(mid)
            if filled >= target:
                right = mid
            else:
                left = mid + 1
        return left

    target_filled = max(1, c)
    return get_time_needed(target_filled)


solve()

