def solve():
    def bellman_ford(graph, N, P):
        dist = [float('-inf')] * N
        dist[0] = 0

        for _ in range(N):
            for u in range(N):
                for v, w in graph[u]:
                    if dist[v] < dist[u] + w:
                        dist[v] = dist[u] + w

        if dist[N-1] > 0:
