def solve():
    n = int(input())
    operations = 0

    while n > 1:
        sqrt_n = int(math.sqrt(n))
        if sqrt_n * sqrt_n == n:
            n = sqrt_n
        else:
            max_factor = 1
            for i in range(2, int(math.sqrt(n)) + 1):
