def solve():
    n = int(input())

    def factorization(num):
        factors = []
        for i in range(2, int(math.sqrt(num)) + 1):
            while num % i == 0:
                factors.append(i)
                num = num // i
        if num > 1:
            factors.append(num)
        return factors

    factors = factorization(n)

    min_val = 1
    min_ops = len(factors)

    for factor in factors:
        min_val *= factor

