def solve():
    MOD = 998244353
    n, m, L, R = map(int, input().split())

    diff_count = R - L + 1
    total_count = n * m
    even_count = total_count // 2
    odd_count = even_count if total_count % 2 == 0 else even_count + 1

    if diff_count == 1:
        if L <= even_count <= R or L <= odd_count <= R:
            return 1
        else:
