    if total_count % 2 == 0:
        ways_even = pow(diff_count, even_count, MOD)
        ways_odd = pow(diff_count, odd_count, MOD)
        ways_total = (ways_even + ways_odd) % MOD
    else:
        ways_total = pow(diff_count, total_count, MOD)

    return ways_total

