# Define a function to solve the prime numbers survey problem
def solve():
    import math

    # Read input values from user input
    a, b, k = map(int, input().split())

    prime_count = [0] * (b - a + 2)
    is_prime = [True] * (b - a + 2)

    # Sieve of Eratosthenes to mark prime numbers
    for i in range(2, int(math.sqrt(b)) + 1):
        for j in range(max(i * i, (a + i - 1) // i * i), b + 1, i):
            is_prime[j - a] = False

    for i in range(1, b - a + 2):
        prime_count[i] = prime_count[i - 1] + is_prime[i - 1]

    # Find minimum l such that at least k primes exist in a window of size l
    min_l = b - a + 2
    for i in range(1, b - a + 2):
        left, right = i, min(b - a + 1, i + k - 1)
