from heapq import heappop, heappush

def solve():
    N, M = map(int, input().split())
    S = list(map(int, input().strip()))
    visited = set()
    q = [(0, [])]

    while q:
        dist, path = heappop(q)

        if dist > N:
            continue

        if dist == N:
            print(*path)
            return

        if dist in visited:
            continue

        visited.add(dist)

        for i in range(1, M + 1):
            new_dist = dist + i
            new_path = path + [i]

            if new_dist <= N and S[new_dist] == 0:
                heappush(q, (new_dist, new_path))

    print(-1)

