from collections import deque

def solve():
    n = int(input())
    strengths = list(map(int, input().split()))

    graph = {i: [] for i in range(1, n+1)}

    for _ in range(n-1):
        u, v = map(int, input().split())
        graph[u].append(v)
        graph[v].append(u)

    online_banks = deque([i for i in range(1, n+1)])

    computer_strength = max(strengths)

    while online_banks:
        current_bank = online_banks.popleft()

        if strengths[current_bank - 1] <= computer_strength:
            for neighbor in graph[current_bank]:
                strengths[neighbor - 1] += 1
                if neighbor in online_banks:
                    online_banks.remove(neighbor)

        if online_banks and strengths[current_bank - 1] > computer_strength:
            computer_strength = strengths[current_bank - 1]

    print(computer_strength)


solve()

