def solve():
    n, m, p = map(int, input().split())
    brackets = input()
    operations = input()

    stack = []
    deleted = [False] * n

    for i in range(n):
        if brackets[i] == '(':
            stack.append(i)
        else:
            j = stack.pop()
            if i == p - 1 or j == p - 1:
                deleted[i] = True
                deleted[j] = True

    for op in operations:
        if op == 'L':
            p -= 1
        elif op == 'R':
            p += 1
        else:
            p1 = p - 1
            p2 = p - 1
            while p1 < n and deleted[p1]:
                p1 += 1
            while p2 >= 0 and deleted[p2]:
                p2 -= 1
            if not (p1 < n and p2 >= 0 and brackets[p1] == ')' and brackets[p2] == '('):
                continue

            deleted[p1] = True
            deleted[p2] = True
            p = p1 + 1

    result = ''
    for i in range(n):
        if not deleted[i]:
            result += brackets[i]

    return result

