    brackets = input().strip()
    operations = input().strip()

    stack = []
    for i in range(n):
        if not stack or brackets[i] == '(':
            stack.append(i)
        else:
            j = stack.pop()
            if i == p - 1 or j == p - 1:
                p = i + j - p + 1
            if not stack:
                start = min(i, j)
                for k in range(start, i+1):
                    brackets = brackets[:k] + ' ' + brackets[k+1:]

    for operation in operations:
        if operation == 'L':
            p = max(p-1, 0)
        elif operation == 'R':
            p = min(p+1, n-1)
        elif operation == 'D':
            if brackets[p] == '(':
                j = stack.index(p)
                del_start = min(p, stack[j+1])
                del_end = max(p, stack[j-1])
                for k in range(del_start, del_end+1):
                    brackets = brackets[:k] + ' ' + brackets[k+1:]
                p = min(stack[j+1], n-1)
            else:
                j = stack.index(p-1)
                del_start = min(p-1, stack[j+1])
                del_end = max(p-1, stack[j-1])
                for k in range(del_start, del_end+1):
                    brackets = brackets[:k] + ' ' + brackets[k+1:]
                p = min(stack[j+1], n-1)

    print(''.join(filter(lambda c: c != ' ', brackets)))

solve()

