def solve():
    n, m, p = map(int, input().split())
    brackets = input().strip()
    operations = input().strip()

    stack = []
    pairs = [-1] * n

    for i in range(n):
        if brackets[i] == '(':
            stack.append(i)
        else:
            j = stack.pop()
            pairs[i] = j
            pairs[j] = i

    cursor = p - 1
    skip_next_left = False

    for op in operations:
        if op == 'L':
            if not skip_next_left:
                cursor -= 1
        elif op == 'R':
            cursor += 1
            if cursor == n or (skip_next_left and pairs[cursor] != -1):
                cursor -= 2
                skip_next_left = False
        else:  # 'D'
            left = cursor
            right = pairs[cursor]

            if left > right:
                left, right = right, left

            brackets = brackets[:left] + brackets[right+1:]
            pairs[left:right+1] = [-1] * (right - left + 1)

            if cursor > left:
                cursor -= (right - left + 1)
                if cursor < left:
                    cursor = left
            else:
                cursor = left

            skip_next_left = True

    return brackets

solve()

