def solve():
    import math

    a, b = map(int, input().split())

    def gcd(x, y):
        while y:
            x, y = y, x % y
        return x

    def lcm(x, y):
        return x * y // gcd(x, y)

    max_period = lcm(a, b)

    factors = set()
    for i in range(1, int(math.sqrt(max_period)) + 1):
        if max_period % i == 0:
            factors.add(i)
            factors.add(max_period // i)

    return len(factors)

