def solve(x: int, n: int) -> int:
    mod = 10**9 + 7

    def prime_factors(num):
        i = 2
        while i * i <= num:
            if num % i:
                i += 1
            else:
                yield i
                num //= i
        if num > 1:
            yield num

    def g(x, p):
        res = 0
        while x % p == 0:
            x //= p
            res += 1
        return p ** res

    def f(x, y):
        prime_divisors = list(set(prime_factors(x)))
        factors = [g(y, p) for p in prime_divisors]
        result = 1
        for factor in factors:
            result = (result * factor) % mod
        return result

    result = 1
    for i in range(1, n + 1):
        result *= f(x, i)
        result %= mod

    return result

