def solve():
    import itertools

    n, a, b = map(int, input().split())

    def get_adjacency_matrix(n, edges):
        adj_matrix = [[0 for _ in range(n)] for _ in range(n)]
        for edge in edges:
            adj_matrix[edge[0]][edge[1]] = 1
            adj_matrix[edge[1]][edge[0]] = 1
        return adj_matrix

    def is_valid(adj_matrix, a, b):
        components = []
        for i in range(n):
            component = set()
            for j in range(n):
                if adj_matrix[i][j] == 1:
                    component.add(j)
            if component not in components:
                components.append(component)
        if len(components) == a:
            complement_matrix = [[1 if adj_matrix[i][j] == 0 else 0 for j in range(n)] for i in range(n)]
            complement_components = []
            for i in range(n):
                component = set()
                for j in range(n):
                    if complement_matrix[i][j] == 1:
                        component.add(j)
                if component not in complement_components:
                    complement_components.append(component)
            if len(complement_components) == b:
                return True, adj_matrix
        return False, None

    edges_combinations = list(itertools.combinations(range(n), 2))
    for comb in itertools.combinations(edges_combinations, a):
