    import itertools

    def get_adjacent_tiles(row, col):
        possible_moves = {(row + i, col + j) for i in range(-1, 2) for j in range(-1, 2)}
        possible_moves.discard((row, col))
        return {(r, c) for r, c in possible_moves if 0 <= r < 2 and 0 <= c < 13}

    def find_path(grid, s, row, col):
        if not s:
            return True

        for r, c in get_adjacent_tiles(row, col):
            if grid[r][c] == s[0]:
                grid[r][c] = "#"  # mark as visited
                if find_path(grid, s[1:], r, c):
                    return True
                grid[r][c] = s[0]  # unmark if path not found

        return False

    s = input().strip()
    grid = [['' for _ in range(13)] for _ in range(2)]
    for i, char in enumerate(s):
        grid[i // 13][i % 13] = char

