def solve():
    n = int(input())

    if n < 10:
        print(n)
        return

    digits = []
    while n > 0:
        digits.append(n % 10)
        n //= 10

    product = 1
    while len(digits) > 1:
        if digits[-1] == 0:
            zeros_count = 1
            while digits[-1] == 0:
                zeros_count += 1
                digits.pop()
            product *= 9
            product *= (digits[-1] - 1)
            for _ in range(zeros_count - 1):
                product *= 9
            digits[-1] -= 1
        else:
            product *= digits.pop()

    product *= digits[0]
    print(product)

