from typing import List

def solve(n: int, m: int, leaders: List[int]) -> List[int]:
    permutation = [0] * n
    for i in range(m - 1):
        current_leader = leaders[i] - 1
        next_person = leaders[i + 1] - 1
        count = next_person - current_leader if current_leader <= next_person else n - current_leader + next_person
        if permutation[current_leader] != 0 and permutation[current_leader] != count:
            return [-1]
        permutation[current_leader] = count
    remaining = set(range(1, n + 1)) - set(leaders)
    for i in range(n):
        if permutation[i] == 0:
            permutation[i] = remaining.pop()
    return permutation

solve()

