def solve():
    import sys

    n = int(input())
    edges = [list(map(int, input().split())) for _ in range(n-1)]

    if n == 1:
        print("YES\n0 0")
        return

    adj_list = {i: [] for i in range(1, n+1)}
    for u, v in edges:
        adj_list[u].append(v)
        adj_list[v].append(u)

    degree = {i: len(adj_list[i]) for i in range(1, n+1)}

    leaves = [i for i in degree if degree[i] == 1]

    if len(leaves) > 1:
        print("NO")
        return

    queue = [leaves[0]]
    position = {leaves[0]: (0, 0)}
    visited = set()

    while queue:
        node = queue.pop(0)
        visited.add(node)
        for neighbor in adj_list[node]:
            if neighbor not in visited:
                queue.append(neighbor)
                for x in adj_list[node]:
                    if x != neighbor:
                        dx, dy = position[node]
                        if degree[x] > 1:
                            position[x] = (dx, dy+1)

    print("YES")
    for i in range(1, n+1):
        print(*position[i])

